// import { useState, useEffect } from "react";
import RoomFilters from "../components/RoomsFilter"

function Quartos() {
    const [roomsContent, setRoomsContent] = useState(apiContent);
    const [filters, setFilters] = useState({
        housekeepingStatus: "",
        frontOfficeStatus: "",
        roomType: "",
        floor: ""
    });
    
    const [uniqueRoomTypes, setUniqueRoomTypes] = useState([]);
    const [uniqueHousekeepingStatuses, setUniqueHousekeepingStatuses] = useState([]);
    const [uniqueFrontOfficeStatuses, setUniqueFrontOfficeStatuses] = useState([]);
    const [uniqueFloors, setUniqueFloors] = useState([])

    useEffect(() => {
        // Obter valores únicos apenas na primeira renderização
        setUniqueRoomTypes([...new Set(roomsContent.housekeepingRoomInfo.housekeepingRooms.room.map(room => room.roomType.roomType))]);
        setUniqueHousekeepingStatuses([...new Set(roomsContent.housekeepingRoomInfo.housekeepingRooms.room.map(room => room.housekeeping.housekeepingRoomStatus.housekeepingRoomStatus))]);
        setUniqueFrontOfficeStatuses([...new Set(roomsContent.housekeepingRoomInfo.housekeepingRooms.room.map(room => room.housekeeping.housekeepingRoomStatus.frontOfficeStatus))]);
        setUniqueFloors([...new Set(roomsContent.housekeepingRoomInfo.housekeepingRooms.room.map(room => room.floor))]);
    }, []); // O array vazio garante que isso só será feito uma vez

    // Filtro de quartos
    function handleFilters(filterType, value) {
        const updatedFilters = { ...filters, [filterType]: value };
        setFilters(updatedFilters);

        const filteredRooms = apiContent.housekeepingRoomInfo.housekeepingRooms.room.filter((room) => {
            return (
                (!updatedFilters.housekeepingStatus || room.housekeeping.housekeepingRoomStatus.housekeepingRoomStatus === updatedFilters.housekeepingStatus) &&
                (!updatedFilters.frontOfficeStatus || room.housekeeping.housekeepingRoomStatus.frontOfficeStatus === updatedFilters.frontOfficeStatus) &&
                (!updatedFilters.roomType || room.roomType.roomType === updatedFilters.roomType) &&
                (!updatedFilters.floor || room.floor === updatedFilters.floor)
            );
        });

        setRoomsContent({
            ...apiContent,
            housekeepingRoomInfo: {
                ...apiContent.housekeepingRoomInfo,
                housekeepingRooms: {
                    room: filteredRooms
                }
            }
        });
    }

    // Filtros disponíveis
    const availableFilters = {
        housekeepingStatus: uniqueHousekeepingStatuses,
        frontOfficeStatus: uniqueFrontOfficeStatuses,
        roomType: uniqueRoomTypes,  // Agora, usa o valor salvo
        floor: uniqueFloors
    };

    return (
        <div className="pt-20">
            <RoomFilters onFilterChange={handleFilters} availableFilters={availableFilters} />

            <div className="grid grid-cols-4 sm:grid-cols-5 md:grid-cols-7 lg:grid-cols-12 gap-2 p-2 max-w-screen-2xl mx-auto">
                {roomsContent.housekeepingRoomInfo.housekeepingRooms.room.map((quarto) => (
                    <QuartoCard key={quarto.roomId} quarto={quarto} />
                ))}
            </div>
        </div>
    );
}

export default Quartos;
